--  Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `nick_name` varchar(45) NOT NULL DEFAULT '' COMMENT '用户昵称',
  `avatar` varchar(100) DEFAULT NULL COMMENT '用户头像',
  `user_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '用户金额',
  `freeze_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '提现中金额',
  `phone` varchar(15) NOT NULL DEFAULT '' COMMENT '电话',
  `is_disable` tinyint(4) NOT NULL DEFAULT '0' COMMENT '禁用状态:  1.禁用  0.启用',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='用户表';

