--  Table structure for `withdraw_deposit`
-- ----------------------------
DROP TABLE IF EXISTS `withdraw_deposit`;
CREATE TABLE `withdraw_deposit` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态\n0.待审核\n1.已通过',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `fk_withdraw_deposit_users1_idx` (`user_id`),
  CONSTRAINT `fk_withdraw_deposit_users1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='提现表';

